        <div className="homepage">
            <header >
              <h1>Hi, <span style={{fontSize:'48px'}}>I AM RIPUDAMAN</span> </h1>              
            </header>
            <div className='description'>
                <Chip
                variant="default"
                size="medium"
                icon={< CodeRoundedIcon/>}
                label="ReactJS"
